import axios from "axios"
const CompA = ()=>{
    const [num,Setval] =useState()
    useEffect( ()=>{
        //alert("hy")
        fetch( "http://api.travelpayouts.com/v2/prices/nearest-places-matrix?currency=usd&origin=LED&destination=HKT&show_to_affiliates=true&token=PutHereYourToken")
        .then(response => {
            console.log(response);
        })
        .catch(err => {
            console.log(err);
        });

    })
  return(
      <> 
      <h1>you have choosed {num}</h1>
    <select onChange={ (e)=>{
        Setval(e.target.value)
    }}>
        <option value="1">1</option>
        <option value="3">3</option>
        <option value="4">4</option>
        <option value="5">5</option>
        <option value="11">11</option>
    </select>
      </>
  )

}

export default CompA;
